import React, { useState } from "react"
function Form(){   
    const [login,setlogin]=useState(false)
    if(login){
        <h1>successfully</h1>
    }else{
        <h2>Not Login</h2>
    }
    return(
    <button onClick={()=>setlogin(false)}>Login</button>
    )
}
export default Form
